import React from "react";
import { X, Plus, Circle } from "lucide-react";
import './Error404.css'; // CSS for your 404 Page

const NotFound = () => {
  return (
    <div className="flex min-h-screen flex-col items-center justify-center bg-[#1A1A1A] px-4 py-12 text-white">
      <div className="relative mx-auto w-full max-w-sm">
        {/* Phone frame */}
        <div className="relative mx-auto w-full max-w-[320px] overflow-hidden rounded-[40px] border-8 border-[#2A2A2A] bg-[#1A1A1A] pb-8 pt-6">
          {/* Notch */}
          <div className="absolute left-1/2 top-0 h-6 w-40 -translate-x-1/2 rounded-b-xl bg-[#2A2A2A]"></div>

          {/* Content container */}
          <div className="relative mx-auto flex h-[500px] w-full flex-col items-center justify-center px-6">
            {/* Decorative elements */}
            <X className="absolute left-[15%] top-[25%] h-5 w-5 text-yellow-400" />
            <X className="absolute right-[20%] top-[40%] h-5 w-5 text-yellow-400" />
            <Plus className="absolute left-[25%] top-[15%] h-5 w-5 text-yellow-400" />
            <Plus className="absolute right-[25%] bottom-[30%] h-5 w-5 text-yellow-400" />
            <Circle className="absolute right-[30%] top-[25%] h-4 w-4 fill-none stroke-yellow-400" />
            <Circle className="absolute left-[40%] top-[40%] h-4 w-4 fill-none stroke-yellow-400" />
            <Circle className="absolute left-[30%] bottom-[35%] h-4 w-4 fill-none stroke-yellow-400" />

            {/* 404 text */}
            <h1 className="mb-8 text-7xl font-bold">404</h1>

            {/* Sorry text */}
            <h2 className="mb-2 text-xl font-medium text-yellow-400">Sorry..</h2>

            {/* Page not found */}
            <p className="mb-4 text-base font-medium">Page Not Found</p>

            {/* Error message */}
            <p className="text-center text-sm text-gray-400">
              Something went wrong.
              <br />
              Please try again.
            </p>
          </div>
        </div>
      </div>
    </div>
  );
};

export default NotFo
